#include <fuzzer/FuzzedDataProvider.h>
#include "xpdf/OutputDev.h"
#include "xpdf/PDFDoc.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
    FuzzedDataProvider stream(data, size);

    // Initialize parameters for PDFDoc::displayPageSlice
    OutputDev* outputDev = reinterpret_cast<OutputDev*>(0x12345678); // Example non-NULL pointer
    int param1 = stream.ConsumeIntegral<int>();
    double param2 = stream.ConsumeFloatingPoint<double>();
    double param3 = stream.ConsumeFloatingPoint<double>();
    int param4 = stream.ConsumeIntegral<int>();
    GBool param5 = static_cast<GBool>(stream.ConsumeBool());
    GBool param6 = static_cast<GBool>(stream.ConsumeBool());
    GBool param7 = static_cast<GBool>(stream.ConsumeBool());
    int param8 = stream.ConsumeIntegral<int>();
    int param9 = stream.ConsumeIntegral<int>();
    int param10 = stream.ConsumeIntegral<int>();
    int param11 = stream.ConsumeIntegral<int>();
    int* param12 = reinterpret_cast<int*>(0x87654321); // Example non-NULL pointer
    void* param13 = reinterpret_cast<void*>(0xABCD); // Example non-NULL pointer

    // Call the function-under-test
    PDFDoc pdfDoc(nullptr); // Passing nullptr to use default constructor
    pdfDoc.displayPageSlice(outputDev, param1, param2, param3, param4, param5, param6, param7, param8, param9, param10, param11, param12, param13);

    return 0;
}

#include <fuzzer/FuzzedDataProvider.h>
#include "PDFDoc.h"
#include "OutputDev.h"

class DummyOutputDev : public OutputDev {
public:
    GBool upsideDown() override { return false; }
    GBool useDrawChar() override { return false; }
    GBool interpretType3Chars() override { return false; }
};

// Define a dummy callback function to pass as an argument
GBool dummyAbortCheck(void* data) {
    return false;
}

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
    FuzzedDataProvider stream(data, size);

    // Initialize parameters for the function-under-test
    DummyOutputDev* outputDev = new DummyOutputDev();
    int page = stream.ConsumeIntegral<int>();
    double xMin = stream.ConsumeFloatingPoint<double>();
    double yMin = stream.ConsumeFloatingPoint<double>();
    int xMax = stream.ConsumeIntegral<int>();
    GBool b1 = stream.ConsumeBool();
    GBool b2 = stream.ConsumeBool();
    GBool b3 = stream.ConsumeBool();
    int rotate = stream.ConsumeIntegral<int>();
    int clip = stream.ConsumeIntegral<int>();
    int sliceX = stream.ConsumeIntegral<int>();
    int sliceY = stream.ConsumeIntegral<int>();
    int sliceW = stream.ConsumeIntegral<int>();
    int sliceH = stream.ConsumeIntegral<int>();
    void* dummyData = reinterpret_cast<void*>(1); // Initialize with a non-NULL value

    // Call the function-under-test
    PDFDoc pdfDoc; // Create an instance of PDFDoc
    pdfDoc.displayPageSlice(outputDev, page, xMin, yMin, xMax, b1, b2, b3, rotate, clip, sliceX, sliceY, sliceW, sliceH, dummyAbortCheck, dummyData);

    // Cleanup
    delete outputDev;

    return 0;
}
